import { createRouter, createWebHistory } from 'vue-router';
import Home from '../views/Home.vue';
import FirstTime from '../views/FirstTime.vue';
import AcademicInquiries from '../views/AcademicInquiries.vue';

const routes = [
  {
    path: '/',
    name: 'Home',
    component: Home
  },
  {
    path: '/first-time',
    name: 'FirstTime',
    component: FirstTime
  },
  {
    path: '/academic-inquiries',
    name: 'AcademicInquiries',
    component: AcademicInquiries
  }
];

const router = createRouter({
  history: createWebHistory(),
  routes
});

export default router;
